import React from 'react'

function ScreenTwo(props) {
    return(
        <div>
            <h1>Next, choose which details you consider most important for the items in your library.</h1>
            <h2>Don't worry, you'll be able to pick and choose further for each album.</h2>
            <input type="checkbox" name="title" value="Title"/><label for="title">Title</label>
            <input type="checkbox" name="artist" value="Artist"/><label for="artist">Artist</label>
            <input type="checkbox" name="genre" value="Genre"/><label for="genre">Genre</label>
        </div>
    )
}

export default ScreenTwo
